<html>

<head>
  <meta charset="utf-8">
  <title>Cultivar</title>
  <!-- <script data-n-head="1" src="js/gh-pages-redirect.js"></script> -->
  <script type="text/javascript">
    // Copyright (c) 2016 Rafael Pedicini, licensed under the MIT License
    var pathPrefix = false;
    var l = window.location;
    l.replace(
      l.protocol + '//' + l.hostname + (l.port ? ':' + l.port : '') +
      l.pathname.split('/').slice(0, 2 * pathPrefix).join('/') + '/open?p=/' +
      l.pathname.slice(1).split('/').slice(pathPrefix).join('/').replace(/&/g, '~and~') +
      (l.search ? '&q=' + l.search.slice(1).replace(/&/g, '~and~') : '') +
      l.hash
    );
  </script>
</head>

<body>
  <h1>Cultivar</h1>
</body>

</html>
